import React from "react";
import styled from "styled-components";
import { SubTitle } from "../../../elements";

const Container = styled("div")`
display:flex;
margin-top:20px;
margin-bottom:60px;
`;
const Card = styled("div")`
width:150px;
height:150px;
position:relative;
box-shadow: 1px 1px 10px rgba(0, 0, 0, 0.161);
cursor: pointer;
`;
const FileSelector = styled("input")`
opacity: 0;
position: absolute;
z-index: -1;

`;



const CenteredElement = styled("label")`
position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  font-family: Open Sans;
font-style: normal;
font-weight: bold;
font-size: 14px;
line-height: 19px;
color: #444444;
cursor: pointer;
`;
const SubTitleWithSpace = styled(SubTitle)`

padding-bottom:10px;
`;


const Document = () => {
    return (
        <>
            <Container>
                <div>
                    <SubTitleWithSpace>Front view</SubTitleWithSpace>
                    <Card >
                        <CenteredElement htmlFor="upload-photo">
                            + Upload
                </CenteredElement>

                        <FileSelector type="file" name="photo" id="upload-photo" />
                    </Card>
                </div>
                <div>
                    <SubTitleWithSpace>Side view</SubTitleWithSpace>
                    <Card>
                        <CenteredElement htmlFor="upload-photo">
                            + Upload
                         </CenteredElement>

                        <FileSelector type="file" name="photo" id="upload-photo" />
                    </Card>
                </div>
            </Container>
        </>
    );
}



export default Document;
